import React from "react";
import { connect } from "react-redux";
import { State } from "./interfaces";

const mapStateToProps = (state: State) => ({
    robot: state.robot,
    gamepad: state.gamepad,
    sensors: state.sensors,
});

const dispatchProps = {
    addGamepad: () => {
        type: "AddGamePad";
    },
};

const connector = connect(mapStateToProps, dispatchProps);

const Controller = (state: State) => (
    <React.Fragment>
        <div>Gamepad Status</div>
        <div>Connected: {state.gamepad.connected?"YES":"NO"}</div>
        <div>X: {state.gamepad.axes.x.toFixed(2)}   <meter min="-1" max="1" value={state.gamepad.axes.x}></meter></div>
        <div>Y: {state.gamepad.axes.y.toFixed(2)}   <meter min="-1" max="1" value={state.gamepad.axes.y}></meter></div>
        <div>OM: {state.gamepad.axes.om.toFixed(2)} <meter min="-1" max="1" value={state.gamepad.axes.om}></meter></div>
        <div>Start: {state.gamepad.toggle.start?1:0}</div>
        <div>Stop: {state.gamepad.toggle.stop?1:0}</div> 
    </React.Fragment>
);
const RobotStatus = (state: State) => (
    <React.Fragment>
        <div>Robot Status</div>
        <div>Connected: {state.robot.connected?"YES":"NO"} </div>
        <div>Voltage: {state.robot.voltage.toFixed(2)} V</div>
    </React.Fragment>
)

const Sensors = (state: State) => (
    <React.Fragment>
        <div>Stethoscope: </div>
        <div>Pulse Oximeter: </div>
        <div>Temperature: </div>
    </React.Fragment>
)

export default connector(Controller);
export const RobotStatusConnected = connector(RobotStatus);
export const AppConnected = connect(mapStateToProps, dispatchProps)(Controller);
export const SensorsConnected = connector(Sensors);
